import React from 'react';



function Display(props){

    return (

        <div>
        <h1>Total Time</h1>
        <span>{props.start}</span>&nbsp;:&nbsp;
        <span>{<h1>1</h1>}</span>&nbsp;:&nbsp;
        <span>{<h1>1</h1>}</span>&nbsp;:&nbsp;


      <div className="row">
        <button className={` button-primary stopwatch-btn-gre button -${isActive ? 'active' : 'inactive'}`} onClick={toggle}>
          {isActive ? 'Stop' : 'Start'}

        </button>
        <button className="stopwatch-btn-gre button" onClick={reset}>
          Reset
        </button>

    </div>


       </div>


      );

};

export default Display;
